def fillna(
    self, value, limit=None, inplace: bool = False, downcast=None
) -> List["Block"]:
    """
    fillna on the block with the value. If we fail, then convert to
    ObjectBlock and try again
    """
    inplace = validate_bool_kwarg(inplace, "inplace")

    mask = isna(self.values)
    if limit is not None:
        limit = libalgos._validate_limit(None, limit=limit)
        mask[mask.cumsum(self.ndim - 1) > limit] = False

    if not self._can_hold_na:
        if inplace:
            return [self]
        else:
            return [self.copy()]

    if self._can_hold_element(value):
        # equivalent: _try_coerce_args(value) would not raise
        blocks = self.putmask(mask, value, inplace=inplace)
        return self._maybe_downcast(blocks, downcast)

    # we can't process the value, but nothing to do
    if not mask.any():
        return [self] if inplace else [self.copy()]

    # operate column-by-column
    def f(mask, val, idx):
        block = self.coerce_to_target_dtype(value)

        # slice out our block
        if idx is not None:
            # i.e. self.ndim == 2
            block = block.getitem_block(slice(idx, idx + 1))
        return block.fillna(value, limit=limit, inplace=inplace, downcast=None)

    return self.split_and_operate(None, f, inplace)

def _maybe_downcast(self, blocks: List["Block"], downcast=None) -> List["Block"]:

    # no need to downcast our float
    # unless indicated
    if downcast is None and (
        self.is_float or self.is_timedelta or self.is_datetime
    ):
        return blocks

    return _extend_blocks([b.downcast(downcast) for b in blocks])

def downcast(self, dtypes=None):
    """ try to downcast each item to the dict of dtypes if present """
    # turn it off completely
    if dtypes is False:
        return self

    values = self.values

    # single block handling
    if self._is_single_block:

        # try to cast all non-floats here
        if dtypes is None:
            dtypes = "infer"

        nv = maybe_downcast_to_dtype(values, dtypes)
        return self.make_block(nv)

    # ndim > 1
    if dtypes is None:
        return self

    if not (dtypes == "infer" or isinstance(dtypes, dict)):
        raise ValueError(
            "downcast must have a dictionary or 'infer' as its argument"
        )
    elif dtypes != "infer":
        raise AssertionError("dtypes as dict is not supported yet")

    # operate column-by-column
    # this is expensive as it splits the blocks items-by-item
    def f(mask, val, idx):
        val = maybe_downcast_to_dtype(val, dtype="infer")
        return val

    return self.split_and_operate(None, f, False)

def astype(self, dtype, copy: bool = False, errors: str = "raise"):
    """
    Coerce to the new dtype.

    Parameters
    ----------
    dtype : str, dtype convertible
    copy : bool, default False
        copy if indicated
    errors : str, {'raise', 'ignore'}, default 'ignore'
        - ``raise`` : allow exceptions to be raised
        - ``ignore`` : suppress exceptions. On error return original object

    Returns
    -------
    Block
    """
    errors_legal_values = ("raise", "ignore")

    if errors not in errors_legal_values:
        invalid_arg = (
            "Expected value of kwarg 'errors' to be one of "
            f"{list(errors_legal_values)}. Supplied value is '{errors}'"
        )
        raise ValueError(invalid_arg)

    if inspect.isclass(dtype) and issubclass(dtype, ExtensionDtype):
        msg = (
            f"Expected an instance of {dtype.__name__}, "
            "but got the class instead. Try instantiating 'dtype'."
        )
        raise TypeError(msg)

    # may need to convert to categorical
    if self.is_categorical_astype(dtype):

        if is_categorical_dtype(self.values):
            # GH 10696/18593: update an existing categorical efficiently
            return self.make_block(self.values.astype(dtype, copy=copy))

        return self.make_block(Categorical(self.values, dtype=dtype))

    dtype = pandas_dtype(dtype)

    # astype processing
    if is_dtype_equal(self.dtype, dtype):
        if copy:
            return self.copy()
        return self

    # force the copy here
    if self.is_extension:
        # TODO: Should we try/except this astype?
        values = self.values.astype(dtype)
    else:
        if issubclass(dtype.type, str):

            # use native type formatting for datetime/tz/timedelta
            if self.is_datelike:
                values = self.to_native_types()

            # astype formatting
            else:
                # Because we have neither is_extension nor is_datelike,
                #  self.values already has the correct shape
                values = self.values

        else:
            values = self.get_values(dtype=dtype)

        # _astype_nansafe works fine with 1-d only
        vals1d = values.ravel()
        try:
            values = astype_nansafe(vals1d, dtype, copy=True)
        except (ValueError, TypeError):
            # e.g. astype_nansafe can fail on object-dtype of strings
            #  trying to convert to float
            if errors == "raise":
                raise
            newb = self.copy() if copy else self
            return newb

    # TODO(extension)
    # should we make this attribute?
    if isinstance(values, np.ndarray):
        values = values.reshape(self.shape)

    newb = make_block(values, placement=self.mgr_locs, ndim=self.ndim)

    if newb.is_numeric and self.is_numeric:
        if newb.shape != self.shape:
            raise TypeError(
                f"cannot set astype for copy = [{copy}] for dtype "
                f"({self.dtype.name} [{self.shape}]) to different shape "
                f"({newb.dtype.name} [{newb.shape}])"
            )
    return newb

